import { useState } from "react";
import { Link } from "react-router-dom";
import "./SideBarAdmin.css";

const SideBarAdmin = () => {

    const[collapsed, setCollapsed] = useState(false);

    const handleCollapse = () => {
        setCollapsed(!collapsed);
    }

    return (
        <div className={!collapsed ? "SideBarAdmin" : "SideBarAdmin SideBarAdminCollapsed"}>

            <div className="SideBarLogoBox">
                <img className="SideBarLogo" onClick={handleCollapse}/>
            </div>

            <div className="SideBarActions">
                <Link to="/admin/inicio"><a href="#"><span>In√≠cio</span></a></Link>

                <Link to="/admin/eventos"><a href="#"><span>Eventos</span></a></Link>

                <Link to="/admin/contas"><a href="#"><span>Contas</span></a></Link>
            </div>    
        </div>
    );
}

export default SideBarAdmin;
